import React, { useEffect } from 'react'
import { useDispatch, useSelector } from 'react-redux'
import { GET_ALL_STORE_SAGA } from '../redux/type/StoreType'

export default function Nav() {

    const dispatch = useDispatch()

    useEffect(() => {
        dispatch({
            type: GET_ALL_STORE_SAGA
        })
    }, [])

    return (
        <div>
            <nav className="nav flex-column" style={{ width: '100%%', backgroundColor: '#0d47a1', minHeight: '756px' }}>
                <a className="nav-link" aria-current="page" href="gdsgsd">Active</a>
                <a className="nav-link" href="#gdsg">Link</a>
                <a className="nav-link" href="#gsd">Link</a>
                <a className="nav-link" href="#gsd" tabIndex={-1} aria-disabled="true">Disabled</a>
            </nav>
        </div>
    )
}
